import api from './api';

export const checkIn = async (memberId) => {
    try {
        const response = await api.post(`/attendance/checkin`, { memberId });
        return response.data;
    } catch (error) {
        throw error.response.data;
    }
};

export const checkInMember = async (memberId) => {
    try {
        const response = await api.post(`/attendance/checkin`, { memberId });
        return response.data;
    } catch (error) {
        throw error.response.data;
    }
};

export const checkOut = async (memberId) => {
    try {
        const response = await api.post(`/attendance/checkout`, { memberId });
        return response.data;
    } catch (error) {
        throw error.response.data;
    }
};

export const checkOutMember = async (memberId) => {
    try {
        const response = await api.post(`/attendance/checkout`, { memberId });
        return response.data;
    } catch (error) {
        throw error.response.data;
    }
};

export const getAttendanceLog = async (memberId) => {
    try {
        const response = await api.get(`/attendance/log/${memberId}`);
        return response.data;
    } catch (error) {
        throw error.response.data;
    }
};

const attendanceService = {
    checkIn,
    checkInMember,
    checkOut,
    checkOutMember,
    getAttendanceLog
};

export default attendanceService;
